import React from "react";
import {Container, Typography, Box, Grid, Paper} from "@material-ui/core";
import {makeStyles, withStyles} from "@material-ui/core/styles";
import SvgIcon from "@material-ui/core/SvgIcon";
import Button from "@material-ui/core/Button";

const useStyles = makeStyles(theme => ({
    root: {
        flexGrow: 1,
    },
    paper: {
        background: '#5d62b5',
        marginTop: theme.spacing(10),
        marginBottom: theme.spacing(10),
    },
    typographyHeader: {
        color: '#fff',
        textAlign: 'center',
        paddingTop: theme.spacing(7),
    },
}));

function Appointment() {
    const classes = useStyles();

    return (
        <div className="AppointmentBackgroundImage">
            <div className={classes.root}>
                <Container maxWidth="lg">
                    <Grid
                        container
                        justify="flex-start"
                        alignItems="flex-start"
                        direction="row"
                    >
                        <Grid item sm={6}>
                            <Paper elevation={3} className={classes.paper}>
                                <Typography component="div" className={classes.typographyHeader}>
                                    <Box fontSize="h4.fontSize" fontWeight="fontWeightBold">
                                        Make an appointment
                                    </Box>
                                </Typography>
                            </Paper>
                        </Grid>
                    </Grid>
                </Container>
            </div>
        </div>
    )
}

export default Appointment;
